DROP TABLE IF EXISTS `sys_news`;
CREATE TABLE `sys_news`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `nm` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `cont` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `author` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `read_qty` int(11) NULL DEFAULT 0,
  `up_qty` int(11) NULL DEFAULT 0,
  `down_qty` int(11) NULL DEFAULT 0,
  `rcd_tm` datetime(0) NULL DEFAULT NULL,
  `rele_tm` datetime(0) NULL DEFAULT NULL,
  `img_url` varchar(1024) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `rmks` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `type` tinyint(4) NULL DEFAULT NULL,
  `status` tinyint(4) NULL DEFAULT NULL,
  `crt_tm` datetime(0) NULL DEFAULT NULL,
  `crt_by` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `upd_tm` datetime(0) NULL DEFAULT NULL,
  `upd_by` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `edit_flag` tinyint(4) NULL DEFAULT 0,
  `tnt_id` bigint(20) NULL DEFAULT NULL COMMENT 'ID',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 10014 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

