INSERT INTO `sys_news` VALUES (10002, 'init', '<p>下午3点到现在终于弄好了！！！</p><table border=\"0\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\"><tbody><tr><th style=\"text-align: left;\"><pre><code>@Async<br>    public void savePoint(HttpServletRequest request, String requestId, CommonDataPointVo commonDataPointVo) {<br>        String ip = HttpRequestUtils.getIpAddr(request), key = ip + requestId;<br>        if(StringUtils.isEmpty(ip) || Instant.now().getMillis() &lt;= Optional.ofNullable(pointLock.get(key)).orElse(Long.MIN_VALUE)) return;<br>        commonDataPointVo.setSubjectType(CommonPointSubjectTypeEnum.news.getCode()).setMarkTime(new Date());<br>        JSONObject result, resObj = new RestTemplate().getForObject(\"http://apis.juhe.cn/ip/ipNew?key=71419bf9df89992b1f86b46adcc4ddbe&amp;ip=\" + ip, JSONObject.class);<br>        if(resObj != null &amp;&amp; \"200\".equals(resObj.getString(\"resultcode\")) &amp;&amp; (result = resObj.getJSONObject(\"result\")) != null) {<br>            commonDataPointVo.setMarkVal2(ip).setMarkVal2Desc(result.getString(\"Country\") + result.getString(\"Province\") + result.getString(\"City\") + result.getString(\"Isp\"));<br>        }<br>        commonDataPointVo.setMarkVal3(request.getHeader(\"User-Agent\")).setMarkVal3Desc(\"User-Agent\");<br>        commonDataPointService.add(commonDataPointVo);<br>        pointLock.put(key, Instant.now().getMillis() + TimeUnit.SECONDS.toMillis(5));<br>    }</code></pre></th></tr></tbody></table><p><br></p>', 'DD', 0, 0, 0, NULL, NULL, '', '。。。。。。。', NULL, NULL, '2021-07-14 04:55:29', 'admin', '2021-07-17 15:17:22', 'admin', 0, NULL);
INSERT INTO `sys_news` VALUES (10003, 'Java编程-高并发情况下接口性能优化实践-提升吞吐量TPS', '<p>&nbsp;&nbsp;&nbsp;&nbsp;记得前段时间工作中接到一个任务是优化一个下单接口的性能提高接口的吞吐量TPS，前期通过arthas工具跟踪接口的具体方法调用链路及耗时，发现了影响此接口的性能瓶颈主要是加锁的方式，后来变更了锁的方式后性能大大提升。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;程序的大致逻辑是，1.判断余额是否足够&gt;2.保存订单信息&gt;3.扣减钱包余额&gt;4.记录钱包流水；现在我将优化前及优化后的代码分别通过jmeter设置100个线程1s内请求这个接口通过实验观察效果，代码的变更及压测结果大家可以往下看<br></p><h3>优化前：采用悲观锁</h3><blockquote><p>该方案是将整个事务方法加锁，可以保证下单时接口成功的响应，即使余额不足也会友好的返回余额不足的提示，但是不足的是客户端用户等待的时间较长；此种方案如果是用在商品秒杀销量优先场景下也不是很合适。</p></blockquote><h3><em>&gt;代码</em></h3><div><img src=\"https://img-blog.csdnimg.cn/img_convert/28caaecdbbfce481e64c2d20915228a6.png#pic_center\" style=\"max-width:100%;\"><img src=\"https://img-blog.csdnimg.cn/img_convert/d9b2895f933e096e63eded737cbdd7d6.png#pic_center\" style=\"max-width: 100%;\"></div><h3>&gt;压测结果（tps 8.4左右）<br></h3><p><img src=\"https://img-blog.csdnimg.cn/img_convert/6a627ab9001df2d4c403241618a126ac.png#pic_center\" style=\"max-width:100%;\"><br></p><p><img0.08859649122807017\" src=\"https://mmbiz.qpic.cn/mmbiz_png/cSKvw8A2EM9ibfLtkODW8lRT5ibktLiaeBpgT56PGXuaExzVsXILmRDGpzXB09b20v5bsBjicrm9CLuBEyDqQ0MF2A/640?wx_fmt=png\"></img0.08859649122807017\"></p><p></p><h3>优化后：采用乐观锁</h3><blockquote><p>这种方式不会显示的给整个方法上锁，依赖的是通过sql的条件判断达到数据同步防止超卖情况发生，此种方式实际就是乐观锁的一种实现，经测试程序的吞吐量提升了很多，但是不足的是并发高的情况下扣减余额时仅仅通过数据库返回的更新结果不能准确判断是余额不足发生更新异常。</p></blockquote><p><img0.14719626168224298\" src=\"https://mmbiz.qpic.cn/mmbiz_png/cSKvw8A2EM9ibfLtkODW8lRT5ibktLiaeBpcpLhke9PrJJoOdW6uUMbwTBw1zVogtzfnbvIdmc3p0zfAKVuoicf28A/640?wx_fmt=png\"></img0.14719626168224298\"></p><p><img0.5814111261872456\" src=\"https://mmbiz.qpic.cn/mmbiz_png/cSKvw8A2EM9ibfLtkODW8lRT5ibktLiaeBpSrkL1AR2JGuhnKIckPsG8bXnxPWnVPW0pycSG50b1csJQVxEHzIaYQ/640?wx_fmt=png\"></img0.5814111261872456\"></p><p><img0.24285714285714285\" src=\"https://mmbiz.qpic.cn/mmbiz_png/cSKvw8A2EM9ibfLtkODW8lRT5ibktLiaeBpUicicb4v19iagFuy8cMDfNuibJw6HJF7UCF38cJZsuibJoZCpVn6tjh3uSw/640?wx_fmt=png\"></img0.24285714285714285\"></p><h3><img src=\"https://img-blog.csdnimg.cn/img_convert/1cc7d811f9617605e930fb86a01b0e3d.png#pic_center\" style=\"max-width:100%;\"><img src=\"https://img-blog.csdnimg.cn/img_convert/37f8455edfa5573db3de7ca72e0409a9.png#pic_center\" style=\"font-size: 14px; max-width: 100%;\"></h3><h3>&gt;压测结果（tps 30左右）<br></h3><p><img src=\"https://img-blog.csdnimg.cn/img_convert/77b27d4f80bec8da3f447e83d63e20ce.png#pic_center\" style=\"max-width:100%;\"><br></p><p><img0.08604038630377524\" src=\"https://mmbiz.qpic.cn/mmbiz_png/cSKvw8A2EM9ibfLtkODW8lRT5ibktLiaeBpT5JjCZmP9XqH37WNBNWJsrSXRtF1hicm1PYNvq2GzDticWrSJ6QXY4Xg/640?wx_fmt=png\"></img0.08604038630377524\"></p><h3>总结</h3><p>通常影响接口的吞吐量有可能就是锁的粒度的大小，在保证数据同步性的同时我们要根据具体场景具体分析评估后采用合适的锁。</p><p><br></p>', '', 0, 0, 0, NULL, NULL, '', '', NULL, NULL, '2021-08-28 12:53:00', 'admin', '2021-08-28 13:23:09', 'admin', 0, NULL);
INSERT INTO `sys_news` VALUES (10004, '基于java配置nginx获取真实IP代码实例', '<p>1、java代码<br></p><table border=\"0\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\"><tbody><tr><th style=\"text-align: left;\"><span style=\"font-weight: normal;\">/** 获取客户端IP */</span><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;</code><code>public</code> <code>static</code> <code>final</code> <code>String getClientIp(HttpServletRequest request) {</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>String ip = request.getHeader(</code><code>\"X-Forwarded-For\"</code><code>);</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>if</code> <code>(StringUtils.isBlank(ip) || </code><code>\"unknown\"</code><code>.equalsIgnoreCase(ip)|| </code><code>\"127.0.0.1\"</code><code>.equalsIgnoreCase(ip)) {</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>ip = request.getHeader(</code><code>\"Proxy-Client-IP\"</code><code>);</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>}</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>if</code> <code>(StringUtils.isBlank(ip) || </code><code>\"unknown\"</code><code>.equalsIgnoreCase(ip)|| </code><code>\"127.0.0.1\"</code><code>.equalsIgnoreCase(ip)) {</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>ip = request.getHeader(</code><code>\"WL-Proxy-Client-IP\"</code><code>);</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>}</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>if</code> <code>(StringUtils.isBlank(ip) || </code><code>\"unknown\"</code><code>.equalsIgnoreCase(ip)|| </code><code>\"127.0.0.1\"</code><code>.equalsIgnoreCase(ip)) {</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>ip = request.getHeader(</code><code>\"X-Real-IP\"</code><code>);</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>}</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>if</code> <code>(StringUtils.isBlank(ip) || </code><code>\"unknown\"</code><code>.equalsIgnoreCase(ip)|| </code><code>\"127.0.0.1\"</code><code>.equalsIgnoreCase(ip)) {</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>ip = request.getRemoteAddr();</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>}</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>if</code> <code>(StringUtils.isBlank(ip) ||</code><code>\"127.0.0.1\"</code><code>.equals(ip)|| ip.indexOf(</code><code>\":\"</code><code>) &gt; -</code><code>1</code><code>) {</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>try</code> <code>{</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>ip = InetAddress.getLocalHost().getHostAddress();</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>} </code><code>catch</code> <code>(UnknownHostException e) {</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>ip = </code><code>null</code><code>;</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>}</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>}</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>// 对于通过多个代理的情况，第一个IP为客户端真实IP,多个IP按照\',\'分割</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>if</code> <code>(ip != </code><code>null</code> <code>&amp;&amp; ip.length() &gt; </code><code>15</code><code>) {</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>if</code> <code>(ip.indexOf(</code><code>\",\"</code><code>) &gt; </code><code>0</code><code>) {</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>ip = ip.substring(</code><code>0</code><code>, ip.indexOf(</code><code>\",\"</code><code>));</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>}</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>}</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>return</code> <code>ip;</code></span></div><span style=\"font-weight: normal;\"><code style=\"font-size: 14px;\">&nbsp;&nbsp;</code><code style=\"font-size: 14px;\">}</code><br></span></th></tr></tbody></table><p><br>2、nginx需要进行相应修改,重点 proxy_set_header<br></p><table border=\"0\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\"><tbody><tr><th style=\"text-align: left;\"><span style=\"font-weight: normal;\"></span>&nbsp;<span style=\"font-weight: normal;\">server {</span><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>listen&nbsp; xxxx;</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>server_name 127.0.0.1;</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code># 静态页面目录</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>root&nbsp;&nbsp; xxxxxxxxxx;</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code># 默认首页</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>index&nbsp;&nbsp; login.html;</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>proxy_set_header Host $http_host;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>proxy_set_header X-Real-IP $remote_addr;</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>proxy_set_header REMOTE-HOST $remote_addr;</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>proxy_set_header X-Forwarded-For $proxy_add_x_forwarded_for;</code></span></div><div><span style=\"font-weight: normal;\">&nbsp;</span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>add_header Access-Control-Allow-Origin *;</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>add_header Access-Control-Allow-Methods </code><code>\'GET,POST\'</code><code>;</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>add_header Access-Control-Allow-Headers </code><code>\'DNT,X-Mx-ReqToken,Keep-Alive,User-Agent,X-Requested-With,If-Modified-Since,Cache-Control,Content-Type,Authorization\'</code><code>;</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>#proxy_cookie_path /* /*;</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>client_max_body_size&nbsp; 100m;</code></span></div><div><span style=\"font-weight: normal;\">&nbsp;</span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>location / {</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>proxy_set_header Host $http_host;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>proxy_set_header X-Real-IP $remote_addr;</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>proxy_set_header REMOTE-HOST $remote_addr;</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>proxy_set_header X-Forwarded-For $proxy_add_x_forwarded_for;</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code>&nbsp;</span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>proxy_set_header Upgrade $http_upgrade;</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>proxy_set_header Connection </code><code>\"upgrade\"</code><code>;</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>add_header Access-Control-Allow-Origin *;</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>add_header Access-Control-Allow-Headers </code><code>\'DNT,X-Mx-ReqToken,Keep-Alive,User-Agent,X-Requested-With,If-Modified-Since,Cache-Control,Content-Type,Authorization\'</code><code>;</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>add_header Access-Control-Allow-Methods GET,POST,OPTIONS;</code></span></div><div><span style=\"font-weight: normal;\"><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>......</code></span></div><div><span