INSERT INTO `sys_news` VALUES (10006, 'CrowdFunding（众筹系统）', '<pre><span id=\"LC1\">    此系统是作者本人在上学期间使用java + servlet + jsp 基础语言开发，没有使用任何现在主流框架，如ssm，maven，很适合新手学习。</span>\n<span id=\"LC2\">此外数据源使用了c3p0连接池，同时系统支持mysql-8，并且兼容mysql5.7</span></pre><pre><span style=\"background-color: rgb(249, 150, 59);\"><span style=\"font-weight: bold;\"><a href=\"https://gitee.com/quhailong/CrowdFunding.git\" target=\"_blank\" style=\"\">码云：</a>https://gitee.com/quhailong/CrowdFunding.git</span><br></span></pre><p><span style=\"background-color: rgb(249, 150, 59);\"><a href=\"https://github.com/quhailong1995/CrowdFunding.git\" target=\"_blank\" style=\"\">GitHub：</a>https://github.com/quhailong1995/CrowdFunding.git</span></p><pre><h2>一、使用</h2><p>1.复制git地址拉取项目然后进行构建</p><p>2.所需依赖jar包位置：/WebContent/WEB-INF/lib</p><p>3.web服务器：Tomcat，</p><p>4.创建数据库名称，运行sql文件，sql文件位置：/sql</p><p>此外项目有问题欢迎提出 ，安装运行过程中遇到问题可以联系我的 QQ ： 1324459373，qq 群：69405215</p><h2><a id=\"二项目概述\" href=\"https://gitee.com/quhailong/CrowdFunding#%E4%BA%8C%E9%A1%B9%E7%9B%AE%E6%A6%82%E8%BF%B0\"></a>二、项目概述</h2><p>基础流程介绍（发布项目--审核--用户支持购买项目服务）</p><p>后台项目审核页面地址 ${根页面url}/admin ; 管理员账号：admin，密码：123456</p><h3><a id=\"一注册登陆后发起项目\" href=\"https://gitee.com/quhailong/CrowdFunding#%E4%B8%80%E6%B3%A8%E5%86%8C%E7%99%BB%E9%99%86%E5%90%8E%E5%8F%91%E8%B5%B7%E9%A1%B9%E7%9B%AE\"></a>一、注册登陆后发起项目</h3><h4><a id=\"1基础信息\" href=\"https://gitee.com/quhailong/CrowdFunding#1%E5%9F%BA%E7%A1%80%E4%BF%A1%E6%81%AF\"></a>1.基础信息</h4><p><img src=\"https://oos.yeee.vip/1.%E5%8F%91%E8%B5%B7%E9%A1%B9%E7%9B%AE-%E5%9F%BA%E7%A1%80%E4%BF%A1%E6%81%AF.png\" alt=\"image\"></p><h4><a id=\"2项目信息\" href=\"https://gitee.com/quhailong/CrowdFunding#2%E9%A1%B9%E7%9B%AE%E4%BF%A1%E6%81%AF\"></a>2.项目信息</h4><p><img src=\"https://oos.yeee.vip/2.%E5%8F%91%E8%B5%B7%E9%A1%B9%E7%9B%AE-%E9%A1%B9%E7%9B%AE%E4%BF%A1%E6%81%AF.png\" alt=\"image\"></p><h4><a id=\"3项目详情\" href=\"https://gitee.com/quhailong/CrowdFunding#3%E9%A1%B9%E7%9B%AE%E8%AF%A6%E6%83%85\"></a>3.项目详情</h4><p><img src=\"https://oos.yeee.vip/3.%E5%8F%91%E8%B5%B7%E9%A1%B9%E7%9B%AE-%E9%A1%B9%E7%9B%AE%E8%AF%A6%E6%83%85.png\" alt=\"image\"></p><h4><a id=\"4回报设置\" href=\"https://gitee.com/quhailong/CrowdFunding#4%E5%9B%9E%E6%8A%A5%E8%AE%BE%E7%BD%AE\"></a>4.回报设置</h4><p><img src=\"https://oos.yeee.vip/4.%E5%8F%91%E8%B5%B7%E9%A1%B9%E7%9B%AE-%E5%9B%9E%E6%8A%A5%E8%AE%BE%E7%BD%AE.png\" alt=\"image\"></p><h4><a id=\"5编辑预览\" href=\"https://gitee.com/quhailong/CrowdFunding#5%E7%BC%96%E8%BE%91%E9%A2%84%E8%A7%88\"></a>5.编辑预览</h4><p><img src=\"https://oos.yeee.vip/5.%E5%8F%91%E8%B5%B7%E9%A1%B9%E7%9B%AE-%E7%BC%96%E8%BE%91%E9%A2%84%E8%A7%88.png\" alt=\"image\"></p><h3><a id=\"二前台页面\" href=\"https://gitee.com/quhailong/CrowdFunding#%E4%BA%8C%E5%89%8D%E5%8F%B0%E9%A1%B5%E9%9D%A2\"></a>二、前台页面</h3><h4><a id=\"1项目详情\" href=\"https://gitee.com/quhailong/CrowdFunding#1%E9%A1%B9%E7%9B%AE%E8%AF%A6%E6%83%85\"></a>1.项目详情</h4><p><img src=\"https://oos.yeee.vip/13.%E6%B5%8B%E8%AF%95%E9%A1%B9%E7%9B%AE%20-%E8%AF%A6%E6%83%85%E9%A1%B5.png\" alt=\"image\"></p><h3><a id=\"三个人中心\" href=\"https://gitee.com/quhailong/CrowdFunding#%E4%B8%89%E4%B8%AA%E4%BA%BA%E4%B8%AD%E5%BF%83\"></a>三、个人中心</h3><h4><a id=\"1我的发起\" href=\"https://gitee.com/quhailong/CrowdFunding#1%E6%88%91%E7%9A%84%E5%8F%91%E8%B5%B7\"></a>1.我的发起</h4><p><img src=\"https://oos.yeee.vip/6.%E4%B8%AA%E4%BA%BA%E4%BF%A1%E6%81%AF-%E6%88%91%E7%9A%84%E5%8F%91%E8%B5%B7.png\" alt=\"image\"></p><h4><a id=\"2我的订单\" href=\"https://gitee.com/quhailong/CrowdFunding#2%E6%88%91%E7%9A%84%E8%AE%A2%E5%8D%95\"></a>2.我的订单</h4><p><img src=\"https://oos.yeee.vip/14.%E4%B8%AA%E4%BA%BA%E4%BF%A1%E6%81%AF-%E6%88%91%E7%9A%84%E8%AE%A2%E5%8D%95.png\" alt=\"image\"></p><h4><a id=\"3更新项目动态\" href=\"https://gitee.com/quhailong/CrowdFunding#3%E6%9B%B4%E6%96%B0%E9%A1%B9%E7%9B%AE%E5%8A%A8%E6%80%81\"></a>3.更新项目动态</h4><p><img src=\"https://oos.yeee.vip/11.%E5%8F%91%E8%B5%B7%E8%80%85%E6%9B%B4%E6%96%B0%E9%A1%B9%E7%9B%AE%E5%8A%A8%E6%80%81.png\" alt=\"image\"></p><h4><a id=\"3更新后页面\" href=\"https://gitee.com/quhai