-- ----------------------------
-- Table structure for t_common_data_point
-- ----------------------------
DROP TABLE IF EXISTS `t_common_data_point`;
CREATE TABLE `t_common_data_point`  (
  `id` bigint(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `subject_type` tinyint(4) NULL DEFAULT NULL COMMENT '主体类型',
  `subject_id` bigint(11) NULL DEFAULT NULL COMMENT '主体主键',
  `event` int(11) NULL DEFAULT NULL COMMENT '操作事件',
  `event_desc` varchar(512) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '事件描述',
  `batch_num` int(11) NULL DEFAULT NULL COMMENT '批次',
  `mark_num` int(11) NULL DEFAULT NULL COMMENT '数量',
  `mark_val1` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '值1',
  `mark_val1_desc` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `mark_val2` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '值2',
  `mark_val2_desc` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `mark_val3` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '值3',
  `mark_val3_desc` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `mark_text_val` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `mark_tex_desc` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `opr_source` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '来源渠道',
  `mark_time` datetime(0) NULL DEFAULT NULL COMMENT '时间',
  `int_val1` int(11) NULL DEFAULT NULL COMMENT 'int值1',
  `int_val1_desc` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'int值1描述',
  `int_val2` int(11) NULL DEFAULT NULL COMMENT 'int值2',
  `int_val2_desc` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'int值2描述',
  `create_time` datetime(0) NULL DEFAULT NULL,
  `modify_time` datetime(0) NULL DEFAULT NULL,
  `status` tinyint(1) NULL DEFAULT 0 COMMENT '有效标志 0:有效，1:无效',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `index_subjectType`(`subject_type`) USING BTREE,
  INDEX `index_event`(`event`) USING BTREE,
  INDEX `index_subjectId`(`subject_id`) USING BTREE,
  INDEX `index_intVal1`(`int_val1`) USING BTREE,
  INDEX `index_intVal2`(`int_val2`) USING BTREE,
  INDEX `index_markVal3`(`mark_val3`(32)) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

